I have a Tooltip component that I want to use in different places in my NextJS application. However, I want to ensure that when a new Tooltip is opened, any previously opened Tooltip is closed. Since these Tooltips are isolated from each other and don't have a shared scope, I'm thinking of using React Context to manage their state.

Here's a basic outline of what I have so far:

1. **Tooltip Component**: This is the component that displays the tooltip.
2. **TooltipContext**: This context will manage the state of the tooltips.
3. **TooltipProvider**: This provider will wrap the application and provide the context to all components.

Here's a basic implementation:

### Tooltip Component

```jsx
import React, { useContext } from 'react';
import { TooltipContext } from './TooltipContext';

const Tooltip = ({ children, content }) => {
  const { showTooltip, hideTooltip, isTooltipVisible } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    showTooltip(content);
  };

  const handleMouseLeave = () => {
    hideTooltip();
  };

  return (
    <div onMouseEnter={handleMouseEnter} onMouseLeave={handleMouseLeave}>
      {children}
      {isTooltipVisible && <div className="tooltip">{content}</div>}
    </div>
  );
};

export default Tooltip;
```

### TooltipContext

```jsx
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [isTooltipVisible, setIsTooltipVisible] = useState(false);
  const [tooltipContent, setTooltipContent] = useState('');

  const showTooltip = (content) => {
    setTooltipContent(content);
    setIsTooltipVisible(true);
  };

  const hideTooltip = () => {
    setIsTooltipVisible(false);
  };

  return (
    <TooltipContext.Provider value={{ showTooltip, hideTooltip, isTooltipVisible, tooltipContent }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

### Usage in the Application

```jsx
import React from 'react';
import { TooltipProvider } from './TooltipContext';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip content="This is a tooltip">
          <button>Hover over me</button>
        </Tooltip>
        <Tooltip content="Another tooltip">
          <button>Hover over me too</button>
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

### Explanation

1. **Tooltip Component**: This component uses the `TooltipContext` to show and hide the tooltip. It listens for mouse enter and leave events to trigger the tooltip.
2. **TooltipContext**: This context manages the state of the tooltip. It provides methods to show and hide the tooltip and keeps track of the tooltip content and visibility.
3. **TooltipProvider**: This provider wraps the application and provides the context to all components.

With this setup, when you hover over a button, the corresponding tooltip will be shown, and any previously opened tooltip will be closed. This ensures that only one tooltip is visible at a time.

